Mongoose array of Schema not saving anything beside id<p>I'm creating <code>blog</code> for teaching purposes. I want to have tags (optional). The problem is that it is creating new <code>TagSchema</code> but it saves only the <code>_id</code> in the db for the related post and not the name of the tag.</p>

<p><strong>PostSchema</strong></p>

<pre><code>var mongoose = require('mongoose'),
Comment = require('./Comment'),
Tags = require('./Tag');

var PostSchema = new mongoose.Schema({
  Author: String,
  Title: String,
  Description: String,
  Comments: [{
    type: mongoose.Schema.Types.ObjectId, ref: 'Comment'   
  }],
  Tags: [{
    type: mongoose.Schema.Types.ObjectId, ref: 'Tag'
  }],
  CreatedOn: Date,
  LastEditOn: Date
});

mongoose.model('Post', PostSchema);

module.exports = mongoose.model('Post');
</code></pre>

<p><strong>TagSchema</strong></p>

<pre><code>var mongoose = require('mongoose');

var TagSchema = new mongoose.Schema({
  TagName: String
});

module.exports = mongoose.model('Tag', TagSchema);
</code></pre>

<p>And in the <code>post</code> request</p>

<pre><code>app.post('/post-add', isLogged, (req, res) =&gt; {
    // save new post
    var post = new Post();

    post.Author = req.user.username;
    post.Description = req.body.Description;
    post.Title = req.body.Title;
    post.CreatedOn = new Date();

    if (req.body.Tag.length &gt; 0) {
        var tags = req.body.Tag.split(' ');

        tags.forEach((element, idx) =&gt; {    
            var tag = new Tag();
            tag.TagName = element;

            post.Tags.push(tag);
        });
    }

    post.save((err) =&gt; {
        if (err) return err;

        res.redirect('/');
    });
});
</code></pre>

<p>What am I missing?</p>

