Embed Field: MongoDB Aggregation Pipeline: $match with expression not possible?<p>I'm doing a rather complicated aggregation pipeline and have a rather strange phenomenon - I extracted a short example to visualize my problem here.</p>

<p>It seemed related to <a href="https://stackoverflow.com/questions/47309861/mongodb-addfields-and-match">MongoDb $addFields and $match</a> - but it doesn't contain any information for me to fix the problem at hand.</p>

<p><strong>Note</strong>: Please note that my problem is not with the specific example of using date fields and or dealing with values, the problem is that I'm not able to <code>$match</code> using an expression - using a field that was added before with <code>$addFields</code> or not.</p>

<p>Given MongoDB: 3.6.3 (currently latest)</p>

<p>Let's insert some testdata:</p>

<pre><code>db.testexample.insert({
   "dateField": new ISODate("2016-05-18T16:00:00Z")
});

db.testexample.insert({
   "dateField": new ISODate("2018-05-18T16:00:00Z")
});
</code></pre>

<p>Now let's make simple pipeline that computes only the year of the date and $matches on that:</p>

<pre><code>db.testexample.aggregate([
    {
        "$addFields": {
            "dateFieldYear": {"$year": "$dateField"}
        }
    },
    {
        "$match": {
            "dateFieldYear": {"$eq": "$dateFieldYear"}}
        }
    }
])
</code></pre>

<p>--> No matches</p>

<p>It should match as it's the same field? Maybe with more trickery (using an <code>$add</code>)?</p>

<pre><code>db.testexample.aggregate([
    {
        "$addFields": {
            "dateFieldYear": {"$year": "$dateField"}
        }
    },
    {
        "$match": {
            "dateFieldYear": {"$eq": {"$add": ["$dateFieldYear", 0]}}
        }
    }
])
</code></pre>

<p>--> No matches</p>

<p>Still no dice.. Next i thought that variables altogether are a problem. So let's fix the values:</p>

<pre><code>db.testexample.aggregate([
    {
        "$addFields": {
            "dateFieldYear": {"$year": "$dateField"}
        }
    },
    {
        "$match": {
            "dateFieldYear": {"$eq": {"$add": [2016, 0]}}
        }
    }
])
</code></pre>

<p>--> No matches</p>

<p>Wait.. something is really wrong here.. Let's see with a static value:</p>

<pre><code>db.testexample.aggregate([
    {
        "$addFields": {
            "dateFieldYear": {"$year": "$dateField"}
        }
    },
    {
        "$match": {
            "dateFieldYear": 2016
        }
    }
])
</code></pre>

<p>--> 1 record found! </p>

<p><strong>So my conclusion</strong> seems to be that <em><code>$match</code> cannot take an expression on a field in an aggregate pipeline</em>. But this doesn't seem possible - as the documentation states that <code>$match</code> follows the query syntax <a href="https://docs.mongodb.com/manual/reference/operator/query/" rel="noreferrer">as described here</a>.</p>

<p>Anybody can help how it can be done to <code>$match</code> using the simple example <code>"dateFieldYear": {"$eq": "$dateFieldYear"}}</code> - why doesn't this work as expected?</p>

<p>Thanks so much for any help</p>; Answer: @Dmitriy So I add a class "clearfix" to the div containing the list and define a pseudo class for clearfix in CSS? Somehow that doesn't work or I'm not doing it right.

