How to delete an item in an array using Mongoose/Node.js<p>So I've read and tried to implement the other solutions for this. I'm just trying to get some insight into why it's not working for me. This is my first project with back end work. I'm working my way through a course but wanted to try something on my own to make the concepts stick. </p>

<p>Here is my Schema</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>//ANIMAL
var animalSchema = new mongoose.Schema({
    image: String,
    name: String,
    variety: String,
    DOB: Date,
    logs: [{
        amount: Number,
        notes: String,
        dateMilked: Date
    }],
    created: { type: Date, default: Date.now }
});</code></pre>
</div>
</div>
</p>

<p>So far I've managed to get all of my RESTful routes for animals and logs working except to delete a log.</p>

<p>This is what I have, but it isn't deleting anything - it also doesn't throw any errors.</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>app.delete("/animals/:id/logs/:id", function(req, res) {
    Animal.findOneAndUpdate({ 'logs._id': req.params.id }, {
            $pull: {
                "logs": { "_id": req.body.id }
            }
        }, { safe: true, multi: true },
        function(err, foundAnimal) {
            if (err) {
                console.log(err);
                res.redirect("/");
            }
            else {
                res.redirect("/animals/" + foundAnimal._id + "/logs");
            }
        });
});</code></pre>
</div>
</div>
</p>

<p>Any help or insight would be great!! I'm looking to learn!</p>

