mgo $all query an array with an array and be case insensitive?<p>I have an array of ingredient names that is dynamic and provided per user. I'd like to match it to <code>mongo</code> documents where there is an <code>array</code> of objects called <code>ingredients</code> which has a property <code>name</code>. I've written a query (see below) which will take query parameters from the URL and will return all the documents that have all matching ingredient names, however this search is case sensitive and I'd like it not to be. </p>

<p>I've considered using <code>bson.RegEx</code> with <code>Option: "i"</code>, however I'm not sure how to form this query or apply it to an array of strings.</p>

<p>Here is the case sensitive query:</p>

<pre><code>// Check for ingredients, return all recipes that can be made using supplied ingredients
if qryPrms["ingredients"] != nil {
    mongodQ["ingredients.name"] = bson.M{"$all": qryPrms["ingredients"]}
}
</code></pre>

<p><code>mongodQ</code> is the <code>bson.M</code> I use to query the collection later in the code. Ideally I could apply <code>RegEx</code> to each element in <code>qryPrms["ingredients"]</code> so it would return closely matching ingredients like <code>cheese</code> would return <code>swiss cheese</code> as well. This is also a more general <code>mongodb</code> question I suppose when it comes to querying with a dynamic array.</p>

