How can I add handler to database query results in Lithium<p>I am using the Lithium framework version 1.1.1 in PHP 5.6 with MongoDB. I have updated MongoDB from 3.4 to 3.6 and this ended up requiring the PHP ini variable <code>mongo.long_as_object</code> be set to <code>true</code> for the <code>aggregateCursor()</code> methods to work properly in the legacy MongoDB driver for PHP. This version of Lithium does not yet support the newer MongoDB PHP module. This causes a problem with the way <code>NumberLong</code> values are handled in Lithium since they are converted to a <code>MongoInt64</code> in PHP.</p>

<p>For example: When calling <code>$results-&gt;data()</code> on a <code>DocumentSet</code>, a BSON result such as <code>{ viewers: NumberLong(12345) }</code> will decode to <code>[ 'viewers' =&gt; [ 'value' =&gt; '12345' ] ]</code>. Instead I need the PHP array to be <code>[ 'viewers' =&gt; 12345 ]</code>.</p>

<p>If I add an appropriate handler directly in the <code>lithium\data\entity\Document::_init</code> method then everything works as I expect. For example:</p>

<pre><code>$this-&gt;_handlers += [
    'MongoId' =&gt; function($value) { return (string) $value; },
    'MongoDate' =&gt; function($value) { return $value-&gt;sec; },
    'MongoInt64' =&gt; function($value) { return (int) $value-&gt;value; }
];
</code></pre>

<p>However, directly editing the Lithium library is likely not the best approach especially when upgrading the library to newer version as they are released. Is there a proper way to add this handler elsewhere? Such as in the <code>Connections::add(...)</code> method in the connections.php bootstrap file?</p>

