<pre><code>{
  "_id" : 5,
  "quizzes" : [
     { "wk" : 1, "score" : 10 },
     { "wk" : 2, "score" : 8 },
     { "wk" : 5, "score" : 8 }
  ]
}
</code></pre>

<p>And I want to add new field in each object of quizzes array. 
The expected result should be</p>

<pre><code>{
  "_id" : 5,
  "quizzes" : [
     { "wk" : 1, "score" : 10, "day": 1 },
     { "wk" : 2, "score" : 8, "day": 2 },
     { "wk" : 5, "score" : 8, "day": 3 }
  ]
}

Any solution for this.
</code></pre>; Answer: This *is* about aggregating reports, and then configuring SQ analysis to use the same report for all modules. With default behavior, executing tests on moduleA will produce a coverage report in moduleA/target that contains coverage of classA and classB. When SQ analysis is executed, when analysing moduleA it read moduleA/target/jacoco.exec to set coverage on classA. When analysing moduleB, it looks for coverage report in moduleB/target and don't find one so no coverage is reported on classB. If you configure analysis to use moduleA/target/jacoco.exec for all modules that should work.

